import './Add.css';
function Add(prop){

    return(
        <div>
            <div>
                <h5 id="AddHead">Add header</h5>
                <p>{prop.title}</p>
                <p>{prop.details}</p>
        
                
             </div>
             <button onClick={() => {
                 {console.log(prop.title)}
                {console.log(prop.details)}

             }}></button>
        </div>
    )
}

export default Add;
